import { getPosts } from "../api/posts";
import Navbar from "../components/Navbar";

const Blog = (props) => {
  return (
    <>
      <Navbar />
      <ul>
        {props.posts.map((post) => (
          <li key={post.id}>{post.title}</li>
        ))}
      </ul>
    </>
  );
};

Blog.getInitialProps = async () => {
    const posts = await getPosts();
    return { posts };
  };

export default Blog;
